import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Fill in the sign-up form
    await page.waitForSelector('input[placeholder="First name"]');
    await page.fill('input[placeholder="First name"]', 'John');

    await page.waitForSelector('input[placeholder="Last name"]');
    await page.fill('input[placeholder="Last name"]', 'Doe');

    await page.waitForSelector('input[placeholder="Mobile number or email"]');
    await page.fill('input[placeholder="Mobile number or email"]', 'john.doe@example.com');

    await page.waitForSelector('input[placeholder="New password"]');
    await page.fill('input[placeholder="New password"]', 'SecurePassword123');

    // Select gender (assuming selecting the first radio button)
    await page.waitForSelector('input[type="radio"][name="gender"]');
    await page.click('input[type="radio"][name="gender"]');

    // Take screenshot after filling the form
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_form.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_form.png'));

    // Submit the sign-up form
    await page.waitForSelector('button:contains("Sign Up")');
    await page.click('button:contains("Sign Up")');

    // Wait for navigation or confirmation message
    await page.waitForLoadState('networkidle');

    // Take final screenshot after submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submission.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submission.png'));

    // Extract meaningful data (if applicable)
    const confirmationMessage = await page.textContent('selector-for-confirmation-message'); // Update with actual selector
    const extractedData = { confirmationMessage };

    return {
      success: true,
      action: "Created an event with basic details",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

