    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Extract meaningful data (e.g., check if login was successful)
    const loginSuccess = await page.evaluate(() => {
      return document.querySelector('.some-logout-element') !== null; // Adjust selector based on actual post-login page
    });

    return {
      success: loginSuccess,
      action: "Logged in successfully",
      extractedData: { loggedIn: loginSuccess },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
